PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "drift_acc_types" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "name" TEXT NOT NULL, "primary" INTEGER NOT NULL, "added_date" INTEGER NOT NULL, "update_date" INTEGER NOT NULL, "is_editable" INTEGER NOT NULL DEFAULT 1 CHECK ("is_editable" IN (0, 1)));
CREATE TABLE IF NOT EXISTS "drift_profiles" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "name" TEXT NOT NULL, "alias" TEXT NULL, "address" TEXT NULL, "zip" TEXT NULL, "email" TEXT NULL, "phone" TEXT NULL, "tin" TEXT NULL, "is_selected" INTEGER NOT NULL DEFAULT 0 CHECK ("is_selected" IN (0, 1)), "currency" INTEGER NOT NULL, "global_i_d" TEXT NULL, "is_local" INTEGER NOT NULL DEFAULT 1 CHECK ("is_local" IN (0, 1)), "added_date" INTEGER NOT NULL, "update_date" INTEGER NOT NULL);
CREATE TABLE IF NOT EXISTS "drift_accounts" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "name" TEXT NOT NULL, "open_bal" INTEGER NOT NULL DEFAULT 0, "open_date" INTEGER NOT NULL, "acc_type" INTEGER NOT NULL REFERENCES drift_acc_types (id) ON DELETE CASCADE, "added_date" INTEGER NOT NULL, "update_date" INTEGER NOT NULL, "is_editable" INTEGER NOT NULL DEFAULT 1 CHECK ("is_editable" IN (0, 1)), "profile" INTEGER NOT NULL REFERENCES drift_profiles (id) ON DELETE CASCADE);
CREATE TABLE IF NOT EXISTS "drift_budgets" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "name" TEXT NOT NULL, "interval" INTEGER NOT NULL, "details" TEXT NOT NULL, "start_day" INTEGER NOT NULL DEFAULT 1, "start_date" INTEGER NOT NULL, "profile" INTEGER NOT NULL REFERENCES drift_profiles (id) ON DELETE CASCADE, "added_date" INTEGER NOT NULL, "update_date" INTEGER NOT NULL);
CREATE TABLE IF NOT EXISTS "drift_projects" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "name" TEXT NOT NULL, "description" TEXT NULL, "start_date" INTEGER NULL, "profile" INTEGER NOT NULL REFERENCES drift_profiles (id) ON DELETE CASCADE, "end_date" INTEGER NULL, "status" INTEGER NOT NULL, "budget" INTEGER NULL REFERENCES drift_budgets (id) ON DELETE SET NULL, "added_date" INTEGER NOT NULL, "update_date" INTEGER NOT NULL);
CREATE TABLE IF NOT EXISTS "drift_transactions" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "vch_date" INTEGER NOT NULL, "narr" TEXT NOT NULL, "ref_no" TEXT NOT NULL, "vch_type" INTEGER NOT NULL, "dr" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "cr" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "amount" INTEGER NOT NULL DEFAULT 0, "profile" INTEGER NOT NULL REFERENCES drift_profiles (id) ON DELETE CASCADE, "project" INTEGER NULL REFERENCES drift_projects (id) ON DELETE SET NULL, "added_date" INTEGER NOT NULL, "update_date" INTEGER NOT NULL);
CREATE TABLE IF NOT EXISTS "drift_users" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "name" TEXT NOT NULL, "device_i_d" TEXT NOT NULL, "photo_path" TEXT NOT NULL);
CREATE TABLE IF NOT EXISTS "drift_banks" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "holder_name" TEXT NULL, "institution" TEXT NULL, "branch" TEXT NULL, "branch_code" TEXT NULL, "account_no" TEXT NULL);
CREATE TABLE IF NOT EXISTS "drift_wallets" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE);
CREATE TABLE IF NOT EXISTS "drift_loans" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "institution" TEXT NULL, "interest_rate" REAL NULL, "start_date" INTEGER NULL, "end_date" INTEGER NULL, "agreement_no" TEXT NULL, "account_no" TEXT NULL);
CREATE TABLE IF NOT EXISTS "drift_c_cards" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "institution" TEXT NULL, "statement_date" INTEGER NULL DEFAULT 1, "card_no" TEXT NULL, "card_network" TEXT NULL);
CREATE TABLE IF NOT EXISTS "drift_balances" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "amount" INTEGER NOT NULL DEFAULT 0);
CREATE TABLE IF NOT EXISTS "drift_transaction_photos" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "transaction" INTEGER NOT NULL REFERENCES drift_transactions (id) ON DELETE CASCADE, "path" TEXT NOT NULL);
CREATE TABLE IF NOT EXISTS "drift_budget_accounts" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "budget" INTEGER NOT NULL REFERENCES drift_budgets (id) ON DELETE CASCADE, "amount" INTEGER NOT NULL DEFAULT 0);
CREATE TABLE IF NOT EXISTS "drift_budget_funds" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "budget" INTEGER NOT NULL REFERENCES drift_budgets (id) ON DELETE CASCADE);
CREATE TABLE IF NOT EXISTS "drift_project_photos" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "project" INTEGER NOT NULL REFERENCES drift_projects (id) ON DELETE CASCADE, "path" TEXT NOT NULL);
CREATE TABLE IF NOT EXISTS "drift_subscriptions" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "profile" INTEGER NOT NULL REFERENCES drift_profiles (id) ON DELETE CASCADE, "interval" INTEGER NOT NULL, "day" INTEGER NOT NULL DEFAULT 1, "amount" INTEGER NOT NULL DEFAULT 0, "added_date" INTEGER NOT NULL, "update_date" INTEGER NOT NULL);
CREATE TABLE IF NOT EXISTS "drift_receivables" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account_id" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "total_amount" INTEGER NULL, "paid_date" INTEGER NULL);
CREATE TABLE IF NOT EXISTS "drift_people" ("id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT, "account_id" INTEGER NOT NULL REFERENCES drift_accounts (id) ON DELETE CASCADE, "address" TEXT NULL, "zip" TEXT NULL, "email" TEXT NULL, "phone" TEXT NULL, "tin" TEXT NULL);
COMMIT;
